/**
 * Share dialog for social networks
 */
define(['underscore', 'jquery', 'Utils', 'socket!', 'Params', 'globalVM', 'knockout', 'm/_moduleCliche', 'text!tpl/common/share.jade', 'css!style/common/share'], function (_, $, Utils, socket, P, globalVM, ko, Cliche, jade) {
    'use strict';

    // https://www.iconfinder.com/icons/410527/facebook_social_icon#size=128
    var socials = [
        {
            id: 'fb',
            name: 'Facebook',
            icon: 'data:image/svg+xml;base64,'
        },
        {
            id: 'vk',
            name: 'Vkontakte',
            icon: 'data:image/svg+xml;base64,'
        },
        {
            id: 'gp',
            name: 'Google Plus',
            icon: 'data:image/svg+xml;base64,'
        },
        {
            id: 'ok',
            name: 'Odnoklassniki',
            icon: 'data:image/svg+xml;base64,'
        }/*,
        {
            id: 'tw',
            name: 'Twitter',
            icon: 'data:image/svg+xml;base64,'
        }*//*,
        {
            id: 'tb',
            name: 'Tumblr',
            icon: 'data:image/svg+xml;base64,'
        }*/
    ];

    return Cliche.extend({
        jade: jade,
        options: {
            title: '',
            desc: '',
            img: null,
            linkPage: null,
            linkSocial: null,
            linkObject: null
        },
        create: function () {
            var self = this;
            this.auth = globalVM.repository['m/common/auth'];
            this.socials = socials;

            socials.forEach(function (social) {
                social.action = function (data, evt) {
                    self.share(social.id, data, evt);
                };
            });

            this.show();
        },
        show: function () {
            ga('send', 'event', 'share', 'open', 'share open');

            ko.applyBindings(globalVM, this.$dom[0]);
            globalVM.func.showContainer(this.$container);
            if (this.modal) {
                this.modal.$curtain.addClass('showModalCurtain');
            }
            this.showing = true;
        },
        hide: function () {
            globalVM.func.hideContainer(this.$container);
            this.showing = false;
        },
        linkClick: function (data, evt) {
            var input = evt.target;
            if (input) {
                input.select();
            }

            Utils.copyText();

            evt.stopPropagation();
            return false;
        },
        share: function (network) {
            var url;
            var origin = location.origin || (location.protocol + '://' + location.host);
            var options = this.options;
            var pageUrl = encodeURIComponent(options.linkSocial ? origin + options.linkSocial : document.URL);
            var pageTitle = options.title;
            var pageDesc = options.desc;
            var image = options.img ? origin + options.img : null;
            var popup = function (url) {
                return window.open(url, '', 'menubar=no,toolbar=0,status=0,width=626,height=436');
            };

            if (network === 'fb') {
                popup('https://www.facebook.com/sharer/sharer.php?u=' + pageUrl);
            } else if (network === 'vk') {
                url = 'http://vkontakte.ru/share.php?url=' + pageUrl + '&noparse=';

                if (pageTitle && image) {
                    url += 'true&title=' + encodeURIComponent(pageTitle) + '&image=' + encodeURIComponent(image);
                    if (pageDesc) {
                        url += '&description=' + encodeURIComponent(pageDesc);
                    }
                } else {
                    url += 'false';
                }

                popup(url);
            } else if (network === 'ok') {
                url = 'http://www.odnoklassniki.ru/dk?st.cmd=addShare';
                url += '&st.comments=' + encodeURIComponent('PastVu');
                url += '&st._surl=' + pageUrl;

                popup(url);
            } else if (network === 'gp') {
                popup('https://plus.google.com/share?url=' + pageUrl);
            } else if (network === 'tw') {
                //var _window = popup('');

                //Ch.url.shorten(document.URL, function (shortUrl) {
                //    var maxLength = 140 - shortUrl.length - 6;
                //    if (pageTitle.length > maxLength) {
                //        pageTitle = pageTitle.substr(0, maxLength) + '...';
                //    }
                //    _window.location = 'http://twitter.com/share?text=' + encodeURIComponent(pageTitle) + '&url=' + encodeURIComponent(shortUrl) + '&counturl=' + document.URL;
                //});
            }

            ga('send', 'event', 'share', network, 'share network click');
        }
    });

});